        i = 0
        j = len(arr) - 1
        while i < j:
            if arr[i] > arr[j]:
                return False
            i += 1
            j -= 1
        return True
    def is_bts(arr):
        i = 0
        j = len(arr) - 1
        while i < j:
            if arr[i] < arr[j]:
                return False
            i += 1
            j -= 1
        return True
    def max_len(arr):
        n = len(arr)
        if n <= 1:
            return n
        max_len = 1
        for i in range(n):
            for j in range(i + 1, n):
                if is_bst(arr[i:j+1]) or is_bts(arr[i:j+1]):
                    max_len = max(max_len, j - i + 1)
        return max_len
    return max_len(lst)

